Inputs.OnSetScript:
/*
 * Provide a script to be executed when an      
 * input value is set from a message.                    
 * 
 * Your function might look as follows
 *
 *      function onSet(value /* Integer *) {
 *          setDeviceProperty('level', value);
 *      }
 *
 */
function onSet(value /* String */) {
    const varItem = "this is a varitem";
    logConsole("On Set for Input");
    logConsole(typeof varItem);
    logConsole(typeof value);
    logConsole(value);
    logConsole(value.length);
    if(value === "on") {
        logConsole("Send Pump On Command");
        OutputCommands.pumpon.send();
    }
    else if(value === "off") {
        logConsole("Send Pump Off Command");
        OutputCommands.pumpoff.send();
    }
    else {
        logConsole("Neither were selected [" + value + "]");
    }
};

